g2:c.PROCEDURE.g2:a.TEXT:
schedule-rediscovery(conf:class odg-rediscovery-configuration) 
SOD:integer;
interval:integer;
begin
  if the campus of conf = "" then return;
  if the time_of_day of conf < 0 then return;
  {compute number of seconds till runs}
  SOD = 60 * the current hour + the current minute; 
  interval = (60 * quotient (the time_of_day of conf ,100) + remainder (the time_of_day of conf , 100))  - SOD;
  if interval < 0 then interval = interval + 24 * 60;
  if interval > 9 then return;
  repeat 
    exit if interval < 1;
    wait for 1 minute;
    interval = interval - 1;
  end; 

  if there exists an opfo-domain-object O such that (the opfo-external-name of O = the campus of conf) then 
  begin
      call odgs-start-rediscovery (the campus of conf);
  end
   else call devu-error-handler(this procedure, conf, "CONFIG-ERROR",
   the current value of devu-medium-priority, the symbol ODG, "Rediscovery scheduler cannot find campus [the campus of conf] to rediscover", the current value of devu-error-lifetime ); 
end

