odg-compare-G2-to-AD(mark: truth-value) 
O:class opfo-domain-object;
TV: truth-value;
begin
    for O = each opfo-domain-object do
        if the recipe of the _jvirtual-data of O exists then begin
            TV = call odg-ref-lookup(the opfo-external-name of O) across odg-interface ;
            if the dsm-deletion-marker that is dsm-marked-for-deletion-of O does not exist and not(TV) then begin
                    inform the operator for the next 5 minutes that "[the opfo-external-name of O] is in G2 but not in AutoDiscovery model";
                    if mark then begin
                        call dxi3-register-domain-item (odg-import-object, the opfo-external-name of O, "", "Delete");
                        call dxi3-commit-domain-registrations (odg-import-object); 
                    end;
                end;
            end;
    end;
  inform the operator for the next 20 seconds that "Comparison complete.";
end

odg-show-g2-model-counts(which:text) 
ODO:class opfo-domain-object;
CC:class class-counter;
CNAME:text;
RESULT:text = "";
Modulename:symbol;
ifcconnects:integer = 0;
{swconns:integer = 0;
swunconns:integer = 0;
rtrconns:integer = 0;
rtrunconns:integer = 0;
ifc:class ipra-interface;}
begin
for CC = each class-counter do delete CC; end;

for ODO = each opfo-domain-object do
  ModuleName = gfr-get-module-of-item (ODO); 
  if "[ModuleName]" = which then begin
      CNAME = "[the class of ODO]";
      if there exists a class-counter CC such that (the class-name of CC = CNAME) then 
        conclude that the class-count of CC = the class-count of CC + 1
       else begin
            create a Class-counter CC;
            conclude that the class-name of CC = CNAME;
       end;
       if there exists a dsm-deletion-marker D that is dsm-marked-for-deletion-of ODO then 
            conclude that the pending-deletes of CC = the pending-deletes of CC + 1;
    {   if ODO is an ipra-interface and there exists an opfo-domain-object X that is dxi3-connected-to ODO then ifcconnects = ifcconnects + 1;
       if ODO is an ipra-switch then begin
          for ifc = each ipra-interface that is dxi3-subordinate-of ODO do
              if there exists an opfo-domain-object that is dxi3-connected-to ifc then 
                    swconns = swconns + 1
              else swunconns = swunconns + 1;
          end;
       end;
       if ODO is an ipra-router then begin
          for ifc = each ipra-interface that is dxi3-subordinate-of ODO do
              if there exists an opfo-domain-object that is dxi3-connected-to ifc then 
                    rtrconns = rtrconns + 1
              else rtrunconns = rtrunconns + 1;
          end;
       end;}
    end;
end;

{ Show results }

for CC = each class-counter do
    Result = "[Result]
  [the class-count of CC]  [the class-name of CC] " ;
  if the pending-deletes of CC > 0 then
    result = "[Result] ([the pending-deletes of CC] marked for delete)";
end;
{Result = "[Result]

Connected and Unconnected Interfaces by class: 
  Router  [rtrconns]  [rtrunconns] 
  Switch [swconns]  [swunconns]

Interface connections: [ifcconnects]";}
inform the operator for the next 4 minutes that "[result]";
end

