txt:text;

Begin   


    if action = "Delete" or action = "delete" or action = "remove" or action = "Remove" then    
        txt = call ODG-FIRE-RELATION-CHANGED-EVENT(O1, Relname, O2, "Delete");
    if action = "Create" or action = "create" or action = "add" or action = "Add" then
        txt = call ODG-FIRE-RELATION-CHANGED-EVENT(O1, Relname, O2, "Create"); 

    return txt;

end

