touch-object(O:class opfo-domain-object, importObj:class dxi3-import-object, objectname:text, classname:text) 
begin
  if the observed of the _jvirtual-data of O exists
    then begin
      { if marked for deletion, un-mark it!}
      if there exists a dsm-deletion-marker DM that is dsm-marked-for-deletion-of O then begin
        make DM transient;
        delete DM;     
      end; 
      conclude that the _jvirtual-data of O = remove-attribute(the _jvirtual-data of O, observed); 
  end;
  {call dxi3-register-domain-item (importObj , objectname, classname, "create");
  call dxi3-commit-domain-registrations (importObj );}
end

receive-denali-not-rediscovered(objname:text)
O:class opfo-domain-object;
F:float;
begin
  if there exists an opfo-domain-object O such that (the opfo-external-name of O = objname) then begin
    F = call g2-unix-time ();
    conclude that the observed of the _jvirtual-data of O = F;
    call dxi3-register-domain-item (odg-import-object, objname, "", "Delete");
    call dxi3-commit-domain-registrations (odg-import-object );
 
  end;

end

odgs-start-rediscovery(Campus:text) 
TV: truth-value;
S:class SITE;
begin
  tv = call odg-start-rediscovery (Campus) across odg-interface;
  if not(tv) and there exists a site S such that (the opfo-external-name of S = Campus) then begin
    conclude that the use-deep-delete of S = true;
    call receive-denali-element-delete(Campus, Campus);
  end;
end

