{The attribute named attrName in NetSleuth object with uuid now has the value=attrValue}
process-denali-attribute-change( uuid :text, attrs: class text-array, importObj:class dxi3-import-object) = (integer)

CNTR: integer;
Client: class ui-client-item;
Attname: symbol;
O: class opfo-domain-object;
Success: truth-value;

begin
    Client = call devu-safe-window();

  for CNTR = 1 to the count of each item-or-value in attrs by 2 do
   if attrs[CNTR] /= "" then begin
    if CNTR = 1 then conclude that attr-notifs = attr-notifs + 1;
    if there exists an opfo-domain-object O such that (the _juuid of O = uuid) then begin 
      if there exists an odg-attribute-monitor M such that (the class-definition named by the dxi3-type-class of M exists and O is an instance of the class named by (the dxi3-type-class of M) and the transfer-direction of M = the symbol dtoo and the denali-attribute-name of M = attrs[CNTR - 1]) then begin
 
         call dxi3-register-domain-attribute-value(importObj, the opfo-external-name of O, the dxi3-attribute-name of M, attrs[CNTR]);
      end else begin
            conclude that odg-err-counter = odg-err-counter + 1; 
            call devu-error-handler(odg-interface, odg-interface, "ODG-[odg-err-counter]", 
   the current value of devu-medium-priority, the symbol gateway, "Unable to assign attribute [attrs[CNTR - 1]] to [the opfo-external-name of O]", 16); 
            end 
    end else inform the operator that "Cannot find object with uuid [uuid]"; 
   end; { empty value}
  end;  { for }
  {delete attrs;}
  return 7
end

