odgs-refresh-monitored-attribute-list()
clearName:Symbol = the symbol odg-clear-monitored-attributes;
addName:Symbol = the symbol odg-add-monitored-attribute;
OIC:class odg-attribute-monitor;
rtn:text;
I: integer;
begin
  wait for 1 seconds;
  for i = 1 to 500 do 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    wait for 3  seconds;
  end;
  call the remote-procedure-declaration named by clearName () across odg-interface;
  for OIC = each odg-attribute-monitor do 
    
    if the class-definition named by the dxi3-type-class of OIC does not exist then begin
        change the status icon-color of OIC to red;
        if the workspace of oic exists then show the workspace of oic;
        call receive-odg-error-message("Attempt to monitor attribute for class [the dxi3-type-class of OIC] but this class does not exist."); 
    end
    else if the transfer-direction of OIC = the symbol dtoo then begin
      rtn = call the remote-procedure-declaration named by addName(the dxi3-type-string of OIC, the denali-attribute-name of OIC) across odg-interface;
      if (rtn /= "OK") then begin 
        call receive-odg-error-message("Attempt to monitor attribute for class [the dxi3-type-string of OIC] got error: [rtn]");
        change the status icon-color of OIC to red;
        if the workspace of oic exists then show the workspace of OIC;
      end else change the status icon-color of OIC to lime-green;
    end;
  end; { for loop }
 
end

odgs-refresh-ignore-class-list()
clearName:Symbol = the symbol odg-clear-ignored-classes;
addName:Symbol = the symbol odg-add-ignored-class;
OIC:class odg-ignore-class-object;
rtn:text;
begin
 wait for 1 seconds;
  repeat 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    wait for 3 seconds;
  end;
  call the remote-procedure-declaration named by clearName () across odg-interface;
  for OIC = each odg-ignore-class-object do 
    rtn = call the remote-procedure-declaration named by addName(the dxi3-type-string of OIC) across odg-interface;
    if (rtn /= "") then 
        call receive-odg-error-message( "Attempt to ignore NetSleuth class [the dxi3-type-string of OIC] got error: [rtn]");
  end;
end

odgs-add-monitored-attribute (am:class odg-attribute-monitor ) = (text) 
rpcname:symbol = the symbol odg-add-monitored-attribute;
rtn:text;
begin
 repeat 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    wait for 3 seconds;
  end;  
  if the class-definition named by the dxi3-type-class of am does not exist then begin
    change the status icon-color of am to red;
    return "Class does not exist";
  end;
  rtn = call the remote-procedure-declaration named by rpcname (the dxi3-type-string of am, the denali-attribute-name of am ) 
    across odg-interface;
 if (rtn = "OK") then change the status icon-color of am to lime-green
 else change the status icon-color of am to red;
 return rtn;
end

{The attribute named attrName in NetSleuth object with uuid now has the value=attrValue}
receive-denali-attribute-change( uuid :text, attrs: class text-array) = (integer)
CNTR: integer;
importObj:class dxi3-import-object = odg-import-object; 
possible:symbol; 
O:class opfo-domain-object;
begin
 
 if there exists an opfo-domain-object O such that (the opfo-external-name of O = uuid) then begin
    if the recipe of the _jvirtual-data of O exists then begin
       possible = symbol(the recipe of the _jvirtual-data of O);
       if the dxi3-import-object named by possible exists then 
           importObj = the dxi3-import-object named by possible;
    end; 
  end;

  CNTR = call process-denali-attribute-change(uuid, attrs, importobj);
  delete attrs;
  return CNTR;
end

{ ODG calls this when a recipe is added or status changed.}
receive-denali-recipe-change(note: text, recipe:text) 
importObj:class dxi3-import-object = odg-import-object;
possible:symbol = symbol(recipe);
ODO:Class opfo-domain-object;
begin
  {inform the operator for the next 15 minutes that "[note]";}
  allow other processing;
  wait for 1 second;

  if the dxi3-import-object named by possible exists then importObj = the dxi3-import-object named by possible;
  conclude that the dxi3-transfer-objects-to-domain-map-for-solo-add-delete of importObj = true;
  if position-of-text (":", note) < 1 then begin  { must be a name change }
    for ODO = each opfo-domain-object do
     if the RECIPE of the _jvirtual-data of ODO exists and the RECIPE of the _jvirtual-data of ODO = note
       then conclude that the recipe of the _jvirtual-data of ODO = recipe;
    end;
  end;
end

