{ Domain element added in Integity.
Will return an error message or the uuid of create object.}
ODG-REQUEST-ELEMENT-ADD-ASYNC  (nam: text, class:text, containerName:text, ATTRNAMEs: class text-list, ATTRVALS: class text-list)= (text)
txt:text;
result:text;
rpcname:symbol = the symbol odg-add-element;
retries: integer = 1200;
Begin   
   if the count of each text in ATTRNAMES < 1 then return "Cannot add with empty attribute list";
   if the count of each text in ATTRVALS < 1 then return "Cannot add with empty attribute list";
 
   result = call odg-find-denali-class (symbol(class));
   repeat 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    if retries < 1 then begin
        call receive-odg-error-message ("Add Element abandoned: bridge down over 1 hour");
        return "bridge down";
    end;
    retries = retries - 1; 
    allow other processing;
    wait for 3 seconds;
  end;  
  txt = call the remote-procedure-declaration named by rpcname (containerName, nam ,result,ATTRnames,ATTRvals) across odg-interface ;
   if (is-contained-in-text (txt, "ERROR:")) then begin
              call receive-odg-error-message(txt);
   end;

   return txt;
end

{NetSleuth notifies that object with uuid has been deleted.} 
