TV: truth-value;
O:class opfo-domain-object;
importObj:class dxi3-import-object = odg-import-object; 
possible:symbol = symbol(recipe);
Client: class g2-window;
ES:symbol;
ET:text;
begin

 if the dxi3-import-object named by possible exists then 
    importObj = the dxi3-import-object named by possible;
 
    call dxi3-register-domain-item (importObj, uuid, "", "Delete");
