end

{ Netsleuth object uuid1 is related to uuid2. RelationName = connected or contains, action=add or delete }
receive-denali-relation-change( name1:text, name2:text, relationName:text, action:text, recipe:text) = (integer)
act:text = "create";
ChangeAction: text = "conclude";
rel:text="superior";
importObj:class dxi3-import-object = odg-import-object; 
possible:symbol = symbol(recipe);
RelnCreateProc: symbol;

{PMJ 12Jan01 - added section to set ODO1 and ODO2, ChangeAction text, and a call to DSM-CHANGE-ODO-RELATION-CALL-REGISTERED-METHODS
PMJ 22 Jan01 - moved DSM-CHANGE-ODO-RELATION-CALL-REGISTERED-METHODS to dxi3 dxi3-register-domain-relation } 

begin


 if RelationName /= "contains" and RelationName /= "connected" then begin
    call receive-odg-error-message("Internal error: invalid Relation Name [RelationName] was specified by the ODGateway. Must be contains or connected.");
    return -1;
  end else if RelationName = "connected" then rel = "connected";

  if action /= "add" and action /= "delete" then begin
    call receive-odg-error-message( "Internal error: Invalid Relation action [action] was specified by the ODG. Must be Add or Delete");
    return -1;
  end else if action = "delete" then act = "delete"; 

  conclude that reln-creates = reln-creates + 1;
  if the dxi3-import-object named by possible exists then importObj = the dxi3-import-object named by possible;
 {PMJ 12Jan01 - added this section with new call to registered methods; Removed 22Jan01}

  
    call dxi3-register-domain-relation (importObj, {the opfo-external-name of O1} name1, rel, {the opfo-external-name of O2} name2, act);

  return 13
end

{ Relation changed in INTEGRITY.
Relname must be Connected. Action must be Create or Delete.
Will return "OK" if successful, or an error message. }
ODG-FIRE-RELATION-CHANGED-EVENT   (O1 :class opfo-domain-object, Relname:text, O2:class opfo-domain-object, action:text)= (text)
txt:text;
rpcname:symbol = the symbol odg-change-relation;
retries: integer =1200;
Begin   

    if Relname /= "Connected" then begin
        return "Cannot propagate relation [Relname] to NetSleuth";
    end;
    if action /= "Create" and action /= "Delete" then begin
        return "Cannot specify action of [action]  in relation [Relname] to NetSleuth";
    end;
    repeat 
      exit if the text of the gsi-interface-status of odg-interface = "2";
      if retries < 1 then begin
        call receive-odg-error-message ("Relation change abandoned: bridge down over 1 hour");
        return "bridge down";
    end;
    retries = retries - 1; 
    wait for 3 seconds;
    end;  
    txt = call the remote-procedure-declaration named by rpcname (the opfo-external-name of O1, Relname,the opfo-external-name of O2, action) across odg-interface ;
    if (txt /= "OK") then call receive-odg-error-message(txt);
    return txt;
end

{ Domain element deleted in INTEGRITY}
ODG-FIRE-ELEMENT-DELETE-EVENT   (O :class opfo-domain-object )= (text)
rpcname:symbol = the symbol odg-delete-element;
txt:text;
retries: integer = 1200;
DM:class dsm-deletion-marker;
Begin  

  if the observed of the _jvirtual-data of O exists then return "OK";
  repeat
    exit if the text of the gsi-interface-status of odg-interface = "2"; 
    if retries < 1 then begin
        call receive-odg-error-message ("Element delete abandoned: bridge down over 1 hour");
        return "bridge down";
    end;
    retries = retries - 1; 
    allow other processing;
    wait for 3 seconds;
  end;

   if there exists a dsm-deletion-marker DM that is dsm-marked-for-deletion-of O then begin
       txt = call the remote-procedure-declaration named by rpcname (the opfo-external-name of O) across odg-interface ;
        if (txt /= "OK") then call receive-odg-error-message(txt);

        return txt; 
    end;
    return "OK";
end

{ Given the symbol for an INTEGRITY class, find the corresponding Denali class by examining the DXI3 type-to-class objects. This is somewhat problematic since several denali classes could map to a single INTEGRITYclass, and the reverse lookup could choose either of the denali classes when such an INTEGRITYclass requests a lookup. This relieves the application writer of needing to know the mapping. However, another interface may be required to force the choice of a specific NetSleuth class.
}
odg-find-denali-class(Opexclass:symbol) = (text)
hier:text;
candidate:symbol;
begin
if there exists a dxi3-type-to-class-object D such that (Opexclass = the dxi3-type-class of D and the dxi3-type-string of D /= "") then begin
    return the dxi3-type-string of D;
  end;
if there exists an object-definition O named by Opexclass then begin
  hier = the text of the class-inheritance-path of O;
  
  repeat 
   exit if hier = "";
   if is-contained-in-text ( ",", hier) then begin
     candidate=symbol(get-from-text (hier,1, position-of-text (",",hier) ));
     hier = get-from-text (hier, position-of-text (",", hier) + 2, length-of-text (hier)); 
   end
   else begin
     candidate = symbol(hier);
     hier = "";
   end;
   if there exists a dxi3-type-to-class-object D such that (candidate = the dxi3-type-class of D and the dxi3-type-string of D /= "") then 
     return the dxi3-type-string of D;
  end; 
end;
 { call receive-odg-error-message( "Cannot find NetSleuth class corresponding to [opexclass]");
 signal the symbol ERROR, "Cannot find NetSleuth class corresponding to [opexclass]"; }
 return "com.gensym.nm.model.UnspecifiedDomainElement";
end

{ NetSleuth notifies that object with objectname of type classname has been added. }
{ This procedure should first see if the object with same uuid already exists; if so, done. Next, consider what type of Integrity Class this NetSleuth Class should be translated to. If there is an Integrity object of the appropriate class, with the same objectname, and it has no NetSleuth uuid, then assign it the new one, and consider it added. Otherwise, use DXI3 to add the new object.
}
receive-denali-element-add-to-container( classname: text, uuid:text, ref1: structure, objectname:text, attrs:class text-array, uuid2:text, ref2: structure, classname2:text, objectname2:text) = (integer)
   container:class opfo-domain-object;
   tarray: class text-array;
   possible:symbol;
   importObj:class dxi3-import-object = odg-import-object;
begin 
  conclude that add-notifs = add-notifs + 1;
  if there exists an opfo-domain-object Container such that (the _juuid of Container = uuid2) then begin end
  else begin
        if objectname2 /= "none" then begin
            create a text-array tarray;
            conclude that container-adds = container-adds + 1;
            call receive-denali-element-add (classname2, uuid2,ref2,objectname2 , tarray);
            {delete tarray;}
            if there exists an opfo-domain-object Container such that (the _juuid of Container = uuid2) then begin end 
            else begin
                call receive-odg-error-message ("Unable to add container [objectname2] to hold [objectname]");
                delete attrs;
                return -1;
            end;
        end;
  end;
  if the RECIPE of ref1 exists then begin
    possible = symbol(the recipe of ref1);
    if the dxi3-import-object named by possible exists then importObj = the dxi3-import-object named by possible;
  end;

  if (there exists an opfo-domain-object O such that (the opfo-external-name of O = objectname)) then begin 
      { if was unknown and now is known, delete old and add new}
        if (classname /= "com.gensym.nm.model.UnspecifiedIPDevice" and classname /= "com.gensym.nm.model.UnknownInterface") and (O is an instance of the class named by (odg-unknown-interface-class) or O is an instance of the class named by (odg-unspecified-device-class)) then begin 
              if there exists a dsm-deletion-marker DM that is dsm-marked-for-deletion-of O then begin
                    make DM transient;
                    delete DM;
              end;
              make O transient;
              delete O;
              call dxi3-register-domain-item (importObj , objectname, classname, "create");
               call dxi3-commit-domain-registrations (importObj ); 
         end 
       else call touch-object(O, importObj, objectname, classname);

       { if NetSleuth is unsure, just touch the object, but don't worry about its attributes }
       if classname = "com.gensym.nm.model.UnspecifiedIPDevice" or classname = "com.gensym.nm.model.UnknownInterface" then begin
             delete attrs;
             return 17; 
           end;
   end else begin
      call dxi3-register-domain-item (importObj , objectname, classname, "create");
      call dxi3-commit-domain-registrations (importObj );
  end;

{ after object is added, set some specific attributes }
  if there exists an opfo-domain-object O such that (the opfo-external-name of O = objectname) then begin
     conclude that the _juuid of O = uuid;
     conclude that the _jvirtual-data of O = ref1;
     conclude that the use-deep-delete of O = true;
     if attrs[0] exists and attrs[0] /= "" then call process-denali-attribute-change (uuid,attrs, importObj);
     if objectname2 /= "none" then begin
       call dxi3-register-domain-relation (importObj ,the opfo-external-name of container, "superior", 
             the opfo-external-name of O, "create" );
     end;
  end; 
  delete attrs;
  return 19
end

{NetSleuth notifies that object with objectname of type classname has been added.}
{ This procedure should first see if the object with same uuid already exists; if so, done. Next, consider what type of Integrity Class this NetSleuth Class should be translated to. If there is an Integrity object of the appropriate class, with the same objectname, and it has no NetSleuth uuid, then assign it the new one, and consider it added. Otherwise, use DXI3 to add the new object.
If IPAddress is known from NetSleuth and there is place to store it in Integrity, then save it.
Currently passing an array (size = 2) of attribute names and values. Will be made more general.
}
receive-denali-element-add( classname: text, uuid: text, ref: structure, objectname:text, attrs:class text-array) = (integer)
  TV: truth-value;
   NTS:text;
   S:symbol = the symbol address;
   importObj:class dxi3-import-object = odg-import-object; 
   possible:symbol;
   win: class g2-window;

{PMJ- 12Jan01: added the call to devu-safe-window and call to 
DSM-CREATE-OD O-CALL-REGISTERED-METHODS, removed 22Jan01} 

begin 
  conclude that add-notifs = add-notifs + 1;
  if the RECIPE of ref exists then begin
    possible = symbol(the recipe of ref);
    if the dxi3-import-object named by possible exists then importObj = the dxi3-import-object named by possible;
  end; 
  if there exists an opfo-domain-object O such that (the _juuid of O = uuid) then begin
     call process-denali-attribute-change (uuid, attrs, importObj);
     conclude that the _jvirtual-data of O = ref;
     conclude that the use-deep-delete of O = true;
     delete attrs;
     return 0;
  end;

  {if UUID doesnt exist, but Integity object with this name and appropriate class without uuid exists, assign it}
  if there exists an opfo-domain-object O such that (objectname = the opfo-external-name of O)
   then begin 
     if the _juuid of O = "" then 
     begin
       conclude that the _juuid of O = uuid;
       conclude that the _jvirtual-data of O = ref;
       conclude that the use-deep-delete of O = true; 
       call process-denali-attribute-change (uuid , attrs, importObj); 
       delete attrs;
       return 1;
     end else 
     begin  { this Integity name already exists }
     end;
   end;

  {Go ahead and add}
  conclude that the dxi3-transfer-objects-to-domain-map-for-solo-add-delete of importObj = true;
 
  TV, NTS = call dxi3-register-domain-item (importObj, objectname, classname, "create");
  call process-denali-attribute-change (uuid, attrs, importObj); 
  call dxi3-commit-domain-registrations (importObj);
  if there exists an opfo-domain-object O such that (the opfo-external-name of O = objectname) then begin
     conclude that the _juuid of O = uuid;
     conclude that the _jvirtual-data of O = ref;
     conclude that the use-deep-delete of O = true;
  end; 
  delete attrs;
  return 19
end

{ Domain element added in Integity. Will return OK or an error message. }
ODG-FIRE-ELEMENT-ADD-EVENT   (O :class opfo-domain-object, ContainerName:text)= (text)
result:text;
txt:text;
rpcname:symbol = the symbol odg-add-element; 
names: class text-list;
vals:class text-list;
attrMonitor:class odg-attribute-monitor;
attrsymb:symbol;
valu: item-or-value ;
retries: integer =1200;
Begin   
    result = call odg-find-denali-class (the class of O);
    create a text-list names;
    create a text-list vals;
  { Add attributes and values to their lists }
  for attrMonitor = each odg-attribute-monitor do
    if the transfer-direction of attrMonitor = the symbol otod and O is an instance of the class named by (the dxi3-type-class of attrMonitor) then begin
        insert the denali-attribute-name of AttrMonitor at the end of names;
        attrsymb = symbol(the dxi3-attribute-name of AttrMonitor);
        valu = the item-or-value that is an attribute of O named by attrsymb;
        insert "[valu]" at the end of vals;
    end;
  end;

  repeat 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    if retries < 1 then begin
        call receive-odg-error-message ("element Add abandoned: bridge down over 1 hour");
        return "bridge down";
    end;
    retries = retries - 1; 
    allow other processing;
    wait for 3 seconds;
  end;  
  txt = call the remote-procedure-declaration named by rpcname (containerName, the opfo-external-name of O , result,names,vals) across odg-interface ;
    delete names;
    delete vals;

   if is-contained-in-text ("ERROR:", txt) then begin
      call receive-odg-error-message ( txt );
      return txt;
    end;
    conclude that the _juuid of O = txt;
    return "OK";
    
end

{ Text Attribute changed in INTEGRITY }
ODG-FIRE-ATTRIBUTE-CHANGE-EVENT(O :class opfo-domain-object , ATTRNAME: text, ATTRVAL:text)= (text)
txt:text;
rpcname:symbol = the symbol odg-attribute-value-change;
rpc2name:symbol = the symbol odg-attribute-put;
attrsymbol:symbol;
retries: integer = 1800;
Begin
   if Attrname = "_opfo-highest-message-priority" then begin
      if attrval = "99999" then return "not initialized";
      attrval = call odg-convert-priority ( O, attrval );
   end;
   repeat 
    exit if the text of the gsi-interface-status of odg-interface = "2";
    if retries < 1 then begin
        call receive-odg-error-message ("attribute update abandoned: bridge down over 1 hour");
        return "bridge down";
    end;
    retries = retries - 1;
    allow other processing;
    wait for 2 seconds;
  end;   
    if there exists an odg-attribute-monitor M such that (O is an instance of the class named by (the dxi3-type-class of M ) and ATTRNAME = the dxi3-attribute-name of M and the transfer-direction of M = the symbol otod ) then begin
          txt = call the remote-procedure-declaration named by rpcname (the opfo-external-name of O, the denali-attribute-name of M, ATTRVAL) across odg-interface;
         return txt;
     end
     else begin
        attrsymbol = symbol(attrname);
        txt = call the remote-procedure-declaration named by rpc2name (the opfo-external-name of O, ATTRNAME, the item-or-value that is an attribute of O named by attrsymbol) across odg-interface ;
         if (txt /= "OK") then call receive-odg-error-message( txt);
         return txt; 
     end;
     return "ERROR: Attribute [ATTRNAME] is not configured to go to NetSleuth";
end

