end

{rearrange prior changes.  ODG calls this when the Queue is drained to 0.}
receive-denali-commit-change(recipe:text) = (integer)
possible:symbol = symbol(recipe);
importObj:class dxi3-import-object = odg-import-object;
begin
  if the dxi3-import-object named by possible exists then importObj = the dxi3-import-object named by possible;
  call dxi3-commit-domain-registrations (importObj); 
  start dxi3-rearrange-domain-map (importObj);
  allow other processing;
  wait for 3 seconds;
  conclude that the dxi3-transfer-objects-to-domain-map-for-solo-add-delete of importObj = false;
  return 77
end

_odg-domain-init(Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, client: class ui-client-item)

Intf: class odg-gsi-interface ;
ErrorObj: class g2-error;
devstuffName: symbol = the symbol gdev-internals-workspaces;
intstuffName: symbol = the symbol int-internals-workspaces;

{PMJ 28July00 create procedure along with odg-activate-interfaces-at-startup logic.}

Begin
  if the item S named by devstuffName exists and _odg-core-internals is not a member of S then
    insert _odg-core-internals at the beginning of the item-list named by devstuffName;
  if the item S named by intstuffName exists and _odg-core-internals is not a member of S then
    insert _odg-core-internals at the beginning of the item-list named by intstuffName;

 if not(odg-activate-interfaces-at-startup) then deactivate the subworkspace of ODG-INTERFACES-GOTO
else if odg-activate-interfaces-at-startup then 
   begin
    activate the subworkspace of ODG-INTERFACES-GOTO;
    for Intf = each odg-gsi-interface do
        call _odg-initialize-interface-attributes(Intf);
    end;
   end; 

   { call dsm-subscribe-for-domain-object-deletion(the symbol ODG-PRE-DELETE-DIRECTED-BY-DSM, the symbol PRE-DELETE);}

    call dsm-subscribe-for-domain-object-deletion(the symbol ODG-DSM-FIRE-ELEMENT-DELETE-EVENT, the symbol DELETION, Client); 
    call dsm-subscribe-for-domain-object-creation(the symbol ODG-DSM-FIRE-ELEMENT-ADD-EVENT, the symbol POST-CREATE, Client); 
    call dsm-subscribe-for-domain-object-attribute-change(the symbol ODG-DSM-FIRE-ATTRIBUTE-CHANGE-EVENT, the symbol ATTRIBUTE-CHANGE, Client);   
    call dsm-subscribe-for-domain-object-relation-change (the symbol ODG-DSM-FIRE-RELATION-CREATE-EVENT, the symbol RELATION-CONCLUDE, Client);
    call dsm-subscribe-for-domain-object-relation-change(the symbol ODG-DSM-FIRE-RELATION-DELETE-EVENT, the symbol RELATION-REMOVE, Client); 
    End

on error (ErrorObj)

    inform the operator for the next 5 minutes that "[the error-description of ErrorObj]";
    delete ErrorObj without permanence checks;

end

g2:c.METHOD.g2:a.TEXT:
{ this method converts opfo-highest-message-priority values into strings that mean something to the AutoDiscovery model. To change the mapping, reimplement this method on a more specific class. } 
odg-convert-priority (OBJ:class object, g2val:text) = (text)

begin
   if OBJ is an opfo-domain-object then begin
       if g2val = "6" then return "10";
       if g2val = "5" then return "10";
       if g2val = "3" then return "3";
       if g2val = "1" then return "6";
       if g2val = "2" then return "5";
   end;
   return g2val;
end
